import styles from "./NavPages.module.css";

export default function NavPages({
  setPaginaActual,
  recipesPerPage,
  allRecipes,
  paginaActual,
}) {
  let paginas = [];

  for (let i = 1; i < Math.floor(allRecipes.length / recipesPerPage) + 1; i++) {
    paginas.push(i);
  }
  return (
    <div className={styles.Contenedor}>
      <button className={styles.BotonNav}>Prev</button>
      {paginas.map((element) => {
        console.log(element);
        return (
          <button
            className={styles.Numeros}
            onClick={() => setPaginaActual(element)}
          >
            {element}
          </button>
        );
      })}
      <button className={styles.BotonNav}>Next</button>
    </div>
  );
}
